import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Paper, Typography, Box, Button, FormControl, FormLabel, RadioGroup, Radio, FormControlLabel, TextField, MenuItem, Alert } from '@mui/material';
import axios from 'axios';

const CreateTicket = () => {
  const navigate = useNavigate();
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const [formData, setFormData] = useState({
    type: '',
    product: '',
    usersCount: 1,
    warrantyStatus: false,
    description: '',
    priority: 'medium'
  });

  const softwareProducts = [
    'Kaspersky',
    'Sophos',
    'Forti',
    'Barracuda',
    'Other'
  ];

  const handleChange = (field) => (event) => {
    setFormData({
      ...formData,
      [field]: event.target.value
    });
  };

  const handleSubmit = async () => {
    if (!formData.type || !formData.description) {
      setError('Please fill all required fields');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post(`${process.env.REACT_APP_API_URL}/api/tickets`, formData);
      navigate(`/tickets/${response.data._id}`);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to create ticket');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="md" sx={{ mt: 4, mb: 4 }}>
      <Paper sx={{ p: 4 }}>
        <Typography variant="h4" gutterBottom>
          Create New Support Ticket
        </Typography>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        <Box sx={{ mt: 2 }}>
          <FormControl component="fieldset" required sx={{ mb: 3 }}>
            <FormLabel component="legend">What type of problem are you experiencing?</FormLabel>
            <RadioGroup
              value={formData.type}
              onChange={handleChange('type')}
            >
              <FormControlLabel value="software" control={<Radio />} label="Software Problem" />
              <FormControlLabel value="hardware" control={<Radio />} label="Hardware Problem" />
            </RadioGroup>
          </FormControl>

          {formData.type === 'software' && (
            <>
              <FormControl fullWidth sx={{ mb: 3 }}>
                <FormLabel>Select Software Product</FormLabel>
                <TextField
                  select
                  value={formData.product}
                  onChange={handleChange('product')}
                  fullWidth
                  margin="normal"
                >
                  {softwareProducts.map((product) => (
                    <MenuItem key={product} value={product}>
                      {product}
                    </MenuItem>
                  ))}
                </TextField>
              </FormControl>

              <TextField
                fullWidth
                type="number"
                label="Number of Users"
                value={formData.usersCount}
                onChange={handleChange('usersCount')}
                margin="normal"
                inputProps={{ min: 1 }}
              />
            </>
          )}

          {formData.type === 'hardware' && (
            <FormControl component="fieldset" sx={{ mb: 3 }}>
              <FormLabel component="legend">Warranty Status</FormLabel>
              <RadioGroup
                value={formData.warrantyStatus.toString()}
                onChange={(e) => setFormData({
                  ...formData,
                  warrantyStatus: e.target.value === 'true'
                })}
              >
                <FormControlLabel value="true" control={<Radio />} label="Under Warranty" />
                <FormControlLabel value="false" control={<Radio />} label="Out of Warranty" />
              </RadioGroup>
            </FormControl>
          )}

          <TextField
            fullWidth
            multiline
            rows={4}
            label="Detailed Description"
            value={formData.description}
            onChange={handleChange('description')}
            placeholder="Please describe your issue in detail..."
            margin="normal"
            required
          />

          <FormControl fullWidth sx={{ mt: 2 }}>
            <FormLabel>Priority Level</FormLabel>
            <RadioGroup
              value={formData.priority}
              onChange={handleChange('priority')}
            >
              <FormControlLabel value="low" control={<Radio />} label="Low" />
              <FormControlLabel value="medium" control={<Radio />} label="Medium" />
              <FormControlLabel value="high" control={<Radio />} label="High" />
            </RadioGroup>
          </FormControl>

          <Box sx={{ mt: 3, display: 'flex', justifyContent: 'flex-end' }}>
            <Button
              variant="contained"
              color="primary"
              onClick={handleSubmit}
              disabled={loading}
            >
              {loading ? 'Submitting...' : 'Submit Ticket'}
            </Button>
          </Box>
        </Box>
      </Paper>
    </Container>
  );
};

export default CreateTicket;
